Interfaces are collections of methods signatures. A type "implements" an interface if it has all of the methods of the given interface defined on it. type shape interface { area() float64 perimeter() float64
} type rect struct { width, height float64
} func (r rect) area() float64 { return r.width * r.height
} func (r rect) perimeter() float64 { return 2*r.width + 2*height
} type circle struct { radius float64
} func (c circle) area() float64 { return math.Pi * c.radius * c.radius
} func (c circle) perimeter() float64 { return 2* math.Pi * c.radius
}

