In Go, functions are first-class values. This means that you can do with functions the same things you can do with all other values. assign functions to variables, pass them as arguments to other functions or even return functions from other functions. func add(x, y int) int { return x + y
} func mul(x, y int) int { return x * y
} // Accept a function as a parameter
func aggregate(a, b, c int, arithmetic func(int, int) int) int { return arithmetic(arithmetic(a, b), c)
} func main() { fmt.Println(aggregate(2, 3, 4, add)) fmt.Println(aggregate(2, 3, 4, mul))
} func getPlusNum(num int) func(int) int { return func(x int) { return x + num }
} plusOne := getPlusNum(1)

